import styles from "./Item.module.css"



const Item = ({item}) => {

    let bg = item.img
    

    return(
        <div className={styles.main_item} style={{backgroundImage:"url("+ {bg} + ")"}}>
                <div className={styles.txt}>{item.name}</div>
                <div className={styles.txt}>{item.price}</div>
        </div>
    )
}

export default Item
